# using sliding window
class Solution:
    def lengthOfLongestSubstringKDistinct(self, s: str, k: int) -> int:
        max_count = count = unique = 0
        d = {}
        for i in range(len(s)):
            if unique < k:
                if s[i] not in d:
                    d[s[i]]=1
                    unique+=1
                else:
                    d[s[i]]+=1
                count+=1
            elif unique == k:
                if s[i] in d:
                    d[s[i]]+=1
                    count+=1
                else:
                    d[s[i]]=1
                    val, val_count = (j := next(iter(d)), d.pop(j))
                    count -= val_count
            if count > max_count:
                max_count = count

        return max_count

